query:
query Query($userId: ID){    userNotes(userId: $userId){
        id
        prev_note_version_id
        guid
        version
        title
        text
        user {
            user_id
        }
        create_date
        deleted
        archive
        actual
        note_files {
            id
            note_id
            guid
            data
            filename
        }
    }
}
